import React, { useEffect, useState } from 'react';
import axios from 'axios';


function HKTramInfo() {
    const stop_code = "18W";
    const tramEATApi = `https://hktramways.com/nextTram/geteat.php?stop_code=${stop_code}`;
    const [tramEAT, setTramEAT] = useState();

    useEffect(() => {
    axios
    .get(tramEATApi)
    .then((res) => setTramEAT(res.headers))
    .catch((error) => console.log(error));
    }, []);

    return (
        <div className="hktraminfo">
            {console.log(tramEAT)}
        </div>
    )
}

export default HKTramInfo
